import { useEffect, useState } from "react";
import { Col, Row } from "react-bootstrap";
import Card from "react-bootstrap/Card";
import { Link } from "react-router-dom";

export function Categori() {
  const [Category, setCategory] = useState([]);

  useEffect(() => {
    fetch("http://localhost:8080/api/getCategoryBySubcatId/" + "NULL")
      .then((res) => res.json())
      .then((result) => {
        setCategory(result);
      });
  }, []);

  return (
    <Row>
      {Category.map((cat) => (
        <Col>
          <Link to={"/SubCategory/" + cat.cat_Id}>
            <Card border='info' style={{ width: "18rem" }}>
              <Card.Header>{cat.categoryName}</Card.Header>
              <Card.Body>
                <Card.Img src={cat.catImgPath}></Card.Img>
                <Card.Title></Card.Title>
                <Card.Text></Card.Text>
              </Card.Body>
            </Card>
          </Link>
        </Col>
      ))}
    </Row>
  );
}
